 appearance, looking like a comet.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Cosmos Redshift 7', 'Sextans', 'The name of this galaxy is based on a Redshift (z) measurement of nearly 7 (actually, z = 6.604).[2]');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Eye of Sauron', 'Canes Venatici', 'Due to its resemblance to the Eye of sauron from the Lord of the Rings');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Fireworks Galaxy', 'Cygnus and Cepheus', 'Due to its bright and spotty appearance.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Hockey Stick Galaxies', 'Canes Venatici', 'Its elongated and curved appearance resembles a hockey stick.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Hoags Object', 'Serpens Caput', 'This is named after Art Hoag, who discovered this ring galaxy.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Large Magellanic Cloud', 'Dorado/Mensa', 'Named after Ferdinand Magellan');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Lindsay-Shapley Ring', 'Volans', 'Named after its discoverer, Eric Lindsay, his professor Harlow Shapley, and its nature as a ring galaxy.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Little Sombrero Galaxy', 'Pegasus', 'Named after its similarity to the Sombrero Galaxy.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Medusa Merger', 'Ursa Major', 'Ejected dust from the merging galaxies is said to look like the snakes that the Gorgon Medusa from Greek mythology had on her head.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Sculptor Dwarf Galaxy', 'Sculptor', 'Similar to the Sculpture Galaxies');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Mice Galaxies', 'Coma Berenices', 'Looks are similar to a mouse.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Small Magellanic Cloud', 'Tucana', 'Named after Ferdinand Magellan');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Mayalls Object', 'Ursa Major', 'This is named after Nicholas Mayall, of the Lick Observatory, who discovered it.[4][5][6]');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Milky Way', 'Sagittarius (centre)', 'The appearance from Earth of the galaxy Ð a band of light.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Needle Galaxy', 'Coma Berenices', 'Named due to its slender appearance.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Wolf-Lundmark-Melotte', 'Cetus', 'Named for the three astronomers instrumental in its discovery and identification.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Pinwheel Galaxy', 'Ursa Major', 'Similar in appearance to a pinwheel (toy).');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Sculptor Galaxy', 'Sculptor', 'Named after its location in the Sculptor Constellation. Also called the Silver Dollar or Silver Coin Galaxy, because of its light and circular appearance.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Sombrero Galaxy', 'Virgo', 'Similar in appearance to a sombrero.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Southern Pinwheel Galaxy', 'Hydra', 'Named after its resemblance to the Pinwheel Galaxy and its location in the southern celestial hemisphere.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Sunflower Galaxy', 'Canes Venatici', 'Similar in appearance to a sunflower.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Tadpole Galaxy', 'Draco', 'The name comes from the resemblance of the galaxy to a tadpole.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Triangulum Galaxy', 'Triangulum', 'Named after its location within the Triangulum constellation.');INSERT INTO Galaxy (Name, Constelation, OriginName) VALUES ('Whirlpool Galaxy', 'Canes Venatici', 'From the whirlpool appearance this gravitationally disturbed galaxy exhibits.');